import { makeStyles } from '@material-ui/core/styles';

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: 'green',
        flexGrow: 1,
        height: '500px',
        marginTop: theme.mixins.toolbar.height+ 100,
    },
}));

export default BodyStyle;
